import AgreeAll from "../atoms/agreeButtons/agreeAll";
import AgreeButton from "../atoms/agreeButtons/agreeButton";
import ConsntButton from "../atoms/agreeButtons/consntButton";
import OfferButton from "../atoms/agreeButtons/offerButton";
import SearchAbout from "../atoms/agreeButtons/searchAbout";
import FooterGrop from "./footerGrop";
import React, {useState} from "react";

export type StatusPros  = {
    all : boolean,
    consnt : boolean,
    offer : boolean,
    search : boolean,
    agree : boolean,
    setAgreeStatus : React.Dispatch<React.SetStateAction<StatusPros>>
}
const AgreeButtonGroup = () => {
    const [agreeStatus, setAgreeStatus] = useState<StatusPros>();

    return(
        <div className='border-b pb-6'>
            <AgreeAll status={agreeStatus} setStatus={setAgreeStatus}/>
            <ConsntButton />
            <SearchAbout />
            <OfferButton />
            <AgreeButton />
        </div>
    )
}
export default AgreeButtonGroup;
